const image =
  "data:image/jpeg;base64,";

makeImageBlackAndWhite = () => {
  const canvas = document.getElementById("canvas1");
  //instant of context 2d api to draw 2d objects on canvas
  const ctx = canvas.getContext("2d");

  canvas.width = 455;
  canvas.heigth = 455;

  //just exercise to make image black and white and to understand canvas functions
  //make instance of image class from js
  const image1 = new Image();
  image1.src = image;

  //drawImage used to draw image from starting coordinate to ending if exists

  image1.addEventListener("load", () => {
    ctx.drawImage(image1, 0, 0, 700, 200);
    //to scan image data from canvas and get all pixels for image that we draw in canvas

    const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.heigth);

    //get rgb for each pexils for image
    const scannedData = scannedImage.data;
    for (let i = 0; i < scannedData.length; i += 4) {
      let avg = (scannedData[i] + scannedData[i + 1] + scannedData[i + 2]) / 3;
      scannedData[i] = avg + 2;
      scannedData[i + 1] = avg + 2;
      scannedData[i + 2] = avg + 2;
    }

    scannedImage.data = scannedData;

    //to save image data and print it into the canvas from starting component
    //there is a gray-scale css property to make image gray
    ctx.putImageData(scannedImage, 0, 0);
  });
};
