const myImage = new Image();
myImage.src = image;
const canvas2 = document.getElementById("canvas2");
const ctx2 = canvas2.getContext("2d");
canvas2.width = 455;
canvas2.heigth = 455;
myImage.addEventListener("load", () => {
  console.log("ali");
  ctx2.drawImage(myImage, 0, 0, canvas2.width, canvas2.heigth / 3);
  //this pixels holds image data
  const pixels = ctx2.getImageData(0, 0, canvas2.width, canvas2.heigth);

  //clear canvas and delete the original image after getting the data from it
  ctx2.clearRect(0, 0, canvas2.width, canvas2.heigth / 3);
  //create a simple particle simple
  let particleArray = [];
  const numberOfParticle = 5000;

  //create our own spectrum

  //make our canvas take linear gradiant color

  const gradiant = ctx2.createLinearGradient(
    0,
    0,
    canvas2.width,
    canvas2.heigth
  );

  //change color gradiant for each part of canvas

  gradiant.addColorStop(0.1, "red");
  gradiant.addColorStop(0.2, "black");
  gradiant.addColorStop(0.3, "blue");
  gradiant.addColorStop(0.4, "white");
  gradiant.addColorStop(0.5, "green");
  gradiant.addColorStop(0.6, "gray");
  gradiant.addColorStop(0.7, "yellow");
  gradiant.addColorStop(0.8, "pink");
  gradiant.addColorStop(0.9, "purple");
  gradiant.addColorStop(1, "white");

  //function to caclulate brightness to human eye
  //blue brightness is deferent from green and red and vise vera
  //this function is from web (numbers);

  calaulateRelativeBrightness = (red, green, blue) => {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  };
  //this array will hold the brightness of each pixel along with its x and y coordinate
  let mappedImage = [];
  for (let y = 0; y < canvas2.heigth; y++) {
    let row = [];
    for (let x = 0; x < canvas2.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];

      const brightness = calaulateRelativeBrightness(red, green, blue);
      const cell = [
        (cellBrightness = brightness),
        (cellColor = "rgb(" + red + "," + green + "," + blue + ")"),
      ];
      row.push(cell);
    }
    mappedImage.push(row);
  }

  class Particle {
    constructor() {
      this.x = Math.random() * canvas2.width;
      this.y = 0;
      //falling speed of particles
      this.speed = 0;
      //velocity : random number between 0 and 0.5
      //velocity just to give some randomness
      this.velocity = Math.random() * 0.1;
      //particles will have size between 1.5 and 2.5
      this.size = Math.random() * 1.5 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);

      this.angle = 0;
    }
    //calculate particle position for each frame before we draw it
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);

      //give effect like brightness or etc
      // ctx2.globalCompositeOperation = "soft-light";

      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      )
        this.speed = mappedImage[this.position1][this.position2][0];
      let movement = 2.7 - this.speed + this.velocity;
      this.angle += this.speed / 20;
      this.size = this.speed * 2;
      this.y += movement + Math.sin(this.angle);
      this.x += movement;

      if (this.y >= canvas2.heigth) {
        this.y = 0;
        this.x = Math.random() * canvas2.width;
      }
      if (this.x >= canvas2.width) {
        this.x = 0;
        this.y = Math.random() * canvas2.heigth;
      }
    }
    //to draw particles
    draw() {
      //beginPath to start drawing
      ctx2.beginPath();
      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      )
        ctx2.fillStyle = mappedImage[this.position1][this.position2][1];
      //to draw a circle
      ctx2.arc(this.x, this.y, this.size, 0, Math.PI);
      //fill circles with color
      ctx2.fill();
    }
  }
  init = () => {
    for (let i = 0; i < numberOfParticle; i++) {
      particleArray.push(new Particle());
    }
  };
  init();
  //main animate function
  animate = () => {
    // ctx2.drawImage(myImage, 0, 0, canvas2.width, canvas2.heigth / 3);
    ctx2.globalAlpha = 0.3;

    ctx2.fillStyle = "rgb(0, 0, 0)";
    //draw rectangle
    ctx2.fillRect(0, 0, canvas2.width, canvas2.heigth);
    for (let i = 0; i < particleArray.length; i++) {
      particleArray[i].update();
      particleArray[i].draw();
    }
    requestAnimationFrame(animate);
  };
  animate();
});
